import * as n6 from './common/cldr-data/main/ar/timeZoneNames.json';
import * as n5 from './common/cldr-data/main/ar/numbers.json';
import * as n4 from './common/cldr-data/main/ar/ca-gregorian.json';
import * as n3 from './common/cldr-data/main/de/timeZoneNames.json';
import * as n2 from './common/cldr-data/main/de/numbers.json';
import * as n1 from './common/cldr-data/main/de/ca-gregorian.json';
import * as n0 from './common/cldr-data/supplemental/numberingSystems.json';
import { Component, ViewEncapsulation, Inject, ViewChild } from '@angular/core';
import { DatePickerComponent } from '@syncfusion/ej2-ng-calendars';
import { loadCldr, L10n } from '@syncfusion/ej2-base';

@Component({
    selector: 'control-content',
    templateUrl: 'globalization.html',
    styleUrls: ['datepicker-style.css'],
    encapsulation: ViewEncapsulation.None
})
export class GlobalizationComponent {
    @ViewChild('ejDatePicker') ejDatePicker: DatePickerComponent;
    public rtl: boolean = true;
    public date: Object = new Date();
    locale: string = 'de';
    ngOnInit(): void {
        L10n.load({
            'de': {
                'datepicker': {
                    placeholder: 'WÃ¤hlen Sie ein Datum'
                }
            },
            'en': {
                'datepicker': {
                    placeholder: 'Choose a date'
                }
            },
            'ar': {
                'datepicker': {
                    placeholder: 'Ø§Ø®ØªØ± ØªØ§Ø±ÙŠØ®Ø§'
                }
            }
        });

        loadCldr(
            n0,
            n1,
            n2,
            n3,
            n4,
            n5,
            n6
        );
    }
    changeLocale() {
        let culture: string = (document.getElementById('cultures') as HTMLSelectElement).value;
        this.ejDatePicker.locale = culture;
        this.ejDatePicker.locale === 'ar' ? this.ejDatePicker.enableRtl = true : this.ejDatePicker.enableRtl = false;
        this.ejDatePicker.dataBind();

    }

}

